(3, 'تجميل', 'هذا القسم خاص بالكوافيرات وأخصائيي التجميل والحنة وكل مايلزم تجميل المرأة في المناسبات بإمكان المشاغل أيضا التسجيل في الخدمة', 1, 'https://happyseasons.nadil.com.sa/documents/buty4091280761660086382.png', NULL, '2022-08-10 00:06:22'),
(4, 'مطابخ', 'إختر هذا القسم لتوفير الحلويات والبوفيهات المفتوحة في الحفلات والمناسبات . ', 1, 'https://happyseasons.nadil.com.sa/documents/cheken16964275411660086392.png', NULL, '2022-08-10 00:06:32'),
(5, 'الكوشة', 'اذا كنت تملك كوش للأفراح او كل مايخص الزينة والديكور للحفلات والمناسبات قم بإختيار هذا القسم لتسهيل عملية البحث على المستخدمين والوصول اليكم بيسر ', 1, 'https://happyseasons.nadil.com.sa/documents/kosha10567709171660086417.png', NULL, '2022-08-10 00:06:58'),
(6, 'تنسيق', 'قم بإختيار هذا القسم إذا كنت تملك لوازم الحفلات من إضاءات وسماعات ومطربين وكل مايخص الطرب والصخب في الأفراح والمناسبات ', 1, 'https://happyseasons.nadil.com.sa/documents/party4244550131660086446.png', NULL, '2022-08-10 00:07:26'),
(7, 'حلويات', 'قسم خاص لكل مقدمي الحلويات في المناسبات', 1, 'https://happyseasons.nadil.com.sa/documents/sweet18456288421660086484.png', NULL, '2022-08-10 00:08:04'),
(8, 'الأزياء', 'منسقي فساتين الزفاف والسهرات', 1, 'https://happyseasons.nadil.com.sa/documents/fashion17435415291660086506.png', NULL, '2022-08-10 00:08:26'),
(9, 'حفظ النعم', 'مشاريع حفظ النعم ', 1, 'https://happyseasons.nadil.com.sa/documents/save5542371281660086546.png', NULL, '2022-08-10 00:09:06'),
(10, 'الأسر المنتجة', 'كل خدمات الأسر المنتجة المتعلقة بالافراح والمناسبات', 1, 'https://happyseasons.nadil.com.sa/documents/family18199760731660086563.png', NULL, '2022-08-10 00:09:23');
