(409, 'فندق سما إن', 'إن كانت زيارتك لنا بهدف إقامة حفل زفافك فأنت حتماً في المكان الصحيح ، حيث جهزنا لك قاعتين فخمتين في فندقنا المهيب وجهزنا القاعتين بكل معدات حفل الزفاف المثالي حيث نقوم بتوفير الكنبات والكراسي والطاولات ذات التصميم البهي والأنيق، وفي قاعاتنا هناك ممر راقي وملكي، كما نوفر لك ستيج يجعل اطلالة العرسان على ضيوفهم أجمل كما نوفر لكم نظام صوتي كامل من مكبرات صوت موزعة في اركان القاعات بشكل ذكي يوصل تجربة الصوت المثالية لحفلك، كما نوفر لكم طاقم عمل كامل من صبابات وقهوجية وعاملات ومشرفة على قاعة النساء وجناحاً خاصاً لتجهيز العروس.\n\nنوفر أيضاً في القاعتين التي تبلغ سعة الكبيرة منهما من 100 الى 250 شخص والصغيرة من 40 الى 70 شخص ضيافة مشروبات مثل العصير والماء وعشاء بوفيه مفتوح نحضر فيه لكم ألذ الأطباق المصنوعة على أيدي أفضل الطهاة والمحضرة من مواد طازجة هي الأجود ومختارة بعناية شديدة ومقدمة لكم بشكل جميل وأنيق بشغف وحب.\n\nفندقنا لديه الكثير من الخدمات الأخرى والمفاجآت التي تنتظركم هناك، تذكر دوماً أن ليلة العمر هي اسم على مسمى ولا تتكرر مرتين لذا عليك اختيار المكان الأمثل ليحتضن مناسبتك الهامة هذه ونعدك أن نكون بحجم الثقة التي تعطينا إياها، إن كان زفافك قد اقترب لا تتردد وسارع بالاتصال بنا عبر معلومات الاتصال المتوفرة على صفحتنا وسنجيبكم في أقرب وقت ممكن لنجعل حفلكم رائعاً.', '24.820779770833223', '46.649280432611704', 392, 3, '2', 1, 'الرياض - حي الياسمين ', NULL, NULL, NULL, NULL, NULL, '0114551919', '', '', 'instagram.com/samainnh', '966554844050', 1, NULL, NULL, NULL),
