INSERT INTO `pages` (`id`, `name`, `title`, `content`, `created_at`, `updated_at`) VALUES
(1, 'FAQs', 'الاسئلة الشائعة', '<p dir=\"rtl\"><span style=\"font-size: 18px;\"><b>ما هو تطبيق هابي سيزون؟</b></span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px;\">تطبيق&nbsp;هابي سيزون شريكك في كل مناسبة&nbsp;</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size: 18px;\"><b>ما هو تطبيق هابي سيزون؟</b></span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px;\">تطبيق&nbsp;هابي سيزون شريكك في كل مناسبة&nbsp;</span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size: 18px;\"><b>ما هو تطبيق هابي سيزون؟</b></span></p>\r\n\r\n<p dir=\"rtl\"><span style=\"font-size:14px;\">تطبيق&nbsp;هابي سيزون شريكك في كل مناسبة&nbsp;</span></p>', '2022-07-15 08:56:24', '2022-07-24 22:43:03'),
(2, 'TermsAndConditions', 'الشروط والأحكام', '<p dir=\"rtl\" style=\"text-align: center;\"><span style=\"font-size:16px;\">هنا يتم كتابة الشروط والأحكام الخاصة بالتطبيق.</span></p>', '2022-07-15 08:56:24', '2022-07-24 22:27:10'),
(3, 'Privacy', 'عن التطبيق', '<p style=\"text-align: right;\"><span style=\"font-size:20px;\"><strong>قم بالتسجيل&nbsp;</strong></span></p>\r\n\r\n<p style=\"text-align: right;\">قم بالتسجيل على منصة هابي سيزون لخدمات الأفراح بسهولة فقط قم بتعبئة البيانات الأساسية لحسابك وقم بتفعيل حسابك من خلال رمز التفعيل المرسل لرقم جوالك , بعد ذلك قم بالدخول ال لوحة التحكم وأرفق بعض الصور للخدمة او القاعة أو أي كان ماتقدمه في مجال المناسبات والأفراح</p>\r\n\r\n<p style=\"text-align: right;\"><span style=\"font-size:20px;\"><strong>توثيق الحساب</strong></span></p>\r\n\r\n<p style=\"text-align: right;\">سيتم توثيق حسابك في خلال 48 ساعة من قبل إدارة التطبيق وفريق الدعم الفني , وبعد الموافقة على الحساب يمكنك الأن مشاهدة الخدمة / المنتج الخاص بك على منصة هابي سيزون ليتمكن جميع المستخدمين من الحجز والتواصل مع عبر المنصة</p>\r\n\r\n<p style=\"text-align: right;\"><strong><span style=\"font-size:20px;\">الحجز والخدمات</span></strong></p>\r\n\r\n<p style=\"text-align: right;\">في حال طلب أحد المستخدمين الخدمة الخاصة بك سيتم إشعارك فورا في حسابك الخاص حيث يمكنك الإطلاع على بيانات الحجز أو الخدمة , والإطلاع على بيانات العميل وبذلك يمكنك قبول الطلب أو الرفض بناءاً على رغبتك وتناسب تواريخ ومواعيد الحجوزات على جدول أعمالك</p>\r\n\r\n<p style=\"text-align: right;\">&nbsp;</p>', '2022-07-15 08:56:24', '2022-07-24 22:26:30');
